import React from "react";
import { useReactTable, getCoreRowModel, getPaginationRowModel } from "@tanstack/react-table";
import { useState, useEffect } from "react";    
import Axios from "axios";

function RegistrarClientes(){
    const [trabajosList, setTrabajos] = useState([]);
    const [nombresCliente, setNombres] = useState("");
    const [apellidosCliente, setApellidos] = useState("");
    const [rutCliente, setRut] = useState("");
    const [emailCliente, setEmail] = useState("");
    const [telefonocliente, setTelefono] = useState("");
    const token = localStorage.getItem('token');
    useEffect(() => {
        listarTrabajos();
    }, []);

    const registrarCliente = async() => {
        const datosCliente = {
            rut: rut,
            razonSocial: razonSocial,
            direccion: direccion,
            telefono: telefono,
            email: email,
            numeroCuenta: numeroCuenta,
            idBanco: banco,
            idTipoCuenta: tipoCuenta,
        }
        await Axios.post("http://localhost:8010/api/clientes",datosProveedor,{headers:{'Content-Type':'application/json','Authorization': token}})
        .then(() => {
          getProveedores();
          limpiarCampos();
          Swal.fire({
            title: "<strong>Registrado con Existo!!</strong>",
            html:
              "<i>El Proveedor fue Registrado con Existo!!</i>",
            icon: "success",
            timer: 3000,
          });
        })
        .catch((error) => {
          Swal.fire({
            title: "<strong>Error</strong>",
            html:
                "<i>Atenci√≥n: Hubo un problema al registrar el proveedor</i>",
            icon: "error",
            timer: 3000,
          });
          console.error("Hubo un error al registrar:", error.response);
        });
    };

    const listarTrabajos = async() =>{
        await Axios.get("http://localhost:8010/api/trabajos/listadoTrabajosAdmin",{headers: {'Authorization': token,},})
        .then((response) => {setTrabajos(response.data);})
        .catch((error) => {console.error("Hubo un error al obtener la lista de insumos:", error.response);});
    };
    return(
        <div className='card'>
        <div className='card-header'>
            <h3><span className='fa fa-address-book'></span>&nbsp;Registrar Cliente</h3>
        </div>
        <div className='card-body'>
            <div className="row">
                <div className="col-sm-12 col-md-12 col-lg-12">
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2'><span className="textos"><span className="fa fa-id-card"></span></span></div>
                        <div className="col-sm-5 col-md-5 col-lg-5">
                            <input id="fname" name="name" type="text" placeholder="Nombres" class="textosCajas form-control text-uppercase"></input>
                        </div>
                        <div className='col-sm-5 col-md-5 col-lg-5'>
                            <input id="fname" name="name" type="text" placeholder="Apellidos" class="textosCajas form-control text-uppercase"></input>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'><span className="textos"><span className="fa fa-id-card-o"></span></span></div>
                        <div className="col-sm-5 col-md-5 col-lg-5">
                            <input id="rut" name="rut" type="text" placeholder="Rut" class="textosCajas form-control text-uppercase"/>
                        </div>
                        <div className='col-sm-5 col-md-5 col-lg-5'><span className="textos">Ej.: 11111111-1</span></div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'><span className="textos"><span className="fa fa-envelope"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="email" name="email" type="text" placeholder="email@dominio.cl" class="textosCajas form-control text-uppercase"></input>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'><span className="textos"><span className="fa fa-phone-square"></span></span></div>
                        <div className="col-sm-10 col-md-10 col-lg-10">
                            <input id="fname" name="name" type="text" placeholder="56991231234" class="textosCajas form-control text-uppercase"></input>
                        </div>
                    </div>
                    <div className='row espaciadoVertical'>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'></div>
                        <div className="col-sm-8 col-md-8 col-lg-8 text-center">
                            <button type="submit" className="botonAccion">Registrar</button>
                        </div>
                        <div className='col-sm-2 col-md-2 col-lg-2 text-left'></div>
                    </div>
                </div>
            </div>
        </div>
    </div>
    )
}

export default RegistrarClientes
